// src/pages/AdminVendas.js

import React, { useEffect, useState } from "react";
import {
  Paper, Button, Typography, Table, TableHead,
  TableRow, TableCell, TableBody, IconButton,
  Tooltip, TableContainer, TextField, MenuItem, Stack, Divider, Box
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import { db } from "../firebase";
import {
  collection, onSnapshot, query, orderBy
} from "firebase/firestore";
import { deleteDoc, doc } from "firebase/firestore";
import { formatMoney } from "../utils/helpers";
import {
  PieChart, Pie, BarChart, Bar, Cell, XAxis, YAxis, ResponsiveContainer, Tooltip as ChartTooltip, Legend
} from "recharts";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

// COLOCA AQUI O TEU LOGO EM BASE64 (PNG, 64x64 px recomendado)
const logoBase64 = ""; 

const cores = ["#1976d2", "#2e7d32", "#ffd600", "#ff7043", "#66bb6a", "#5e35b1", "#d84315"];

export default function AdminVendas() {
  const [todasVendas, setTodasVendas] = useState([]);
  const [vendasFiltradas, setVendasFiltradas] = useState([]);
  const [filtroOperador, setFiltroOperador] = useState("todos");
  const [filtroData, setFiltroData] = useState("");
  const [operadoresUnicos, setOperadoresUnicos] = useState([]);

  // Totais e resumos
  const [totaisPorTipo, setTotaisPorTipo] = useState({});
  const [totaisPorOperador, setTotaisPorOperador] = useState({});
  const [totalQuant, setTotalQuant] = useState(0);
  const [totalValor, setTotalValor] = useState(0);
  const [pieData, setPieData] = useState([]);
  const [barData, setBarData] = useState([]);
  
  useEffect(() => {
    const q = query(collection(db, "vendas"), orderBy("dataISO", "desc"));

    const unsub = onSnapshot(q, (snapshot) => {
      const lista = snapshot.docs.map(doc => ({
        id: doc.id,
        ...doc.data()
      }));
      setTodasVendas(lista);

      const nomes = Array.from(
        new Set(lista.map(v => v.operador).filter(Boolean))
      ).sort();
      setOperadoresUnicos(nomes);
    });

    return () => unsub();
  }, []);

  // Filtros por operador/data
  useEffect(() => {
    let filtradas = todasVendas;
    if (filtroOperador !== "todos") {
      filtradas = filtradas.filter(v => v.operador === filtroOperador);
    }
    if (filtroData) {
      filtradas = filtradas.filter(v =>
        v.dataISO?.slice(0, 10) === filtroData
      );
    }
    setVendasFiltradas(filtradas);
  }, [todasVendas, filtroOperador, filtroData]);

  // Calcular totais e dados resumo
  useEffect(() => {
    // Por tipo
    const tipos = {};
    let totalQ = 0, totalV = 0;
    vendasFiltradas.forEach(v => {
      const t = v.tipo;
      if (!tipos[t]) tipos[t] = { quantidade: 0, valor: 0 };
      tipos[t].quantidade += 1;
      tipos[t].valor += parseFloat(v.preco) || 0;
      totalQ += 1;
      totalV += parseFloat(v.preco) || 0;
    });
    setTotaisPorTipo(tipos);
    setTotalQuant(totalQ);
    setTotalValor(totalV);

    setPieData(
      Object.entries(tipos).map(([tipo, info], i) => ({
        name: tipo, value: info.quantidade, cor: cores[i % cores.length]
      }))
    );

    // Por operador
    const ops = {};
    vendasFiltradas.forEach(v => {
      const op = v.operador || "-";
      if (!ops[op]) ops[op] = { quantidade: 0, valor: 0 };
      ops[op].quantidade += 1;
      ops[op].valor += parseFloat(v.preco) || 0;
    });
    setTotaisPorOperador(ops);
    setBarData(
      Object.entries(ops).map(([op, info]) => ({
        operador: op, quantidade: info.quantidade, valor: info.valor
      }))
    );
  }, [vendasFiltradas]);

  async function apagar(id) {
    if (!window.confirm("Tem a certeza que quer apagar esta venda permanentemente?")) return;
    try {
      await deleteDoc(doc(db, "vendas", id));
    } catch (e) {
      alert("Erro ao apagar a venda.");
    }
  }

  // === Exportação PDF ===
  function exportarPDF() {
    const doc = new jsPDF();

    // Logo topo
    const logoW = 22, logoH = 22;
    doc.addImage(logoBase64, "PNG", 10, 10, logoW, logoH);

    // Título centralizado
    doc.setFontSize(16);
    doc.text("Relatório de Vendas", 75, 17);

    let y = 45;

    // Totais globais
    doc.setFontSize(12);
    doc.text(`Total Vendas: ${totalQuant} | Valor: ${totalValor.toLocaleString("pt-PT", { style: "currency", currency: "EUR" })}`, 10, y);

    y += 8;

    // Totais por tipo (mini-tabela)
    doc.setFontSize(11);
    doc.text("Totais por tipo de pulseira:", 10, y);
    y += 4;
    const headTipos = [["Tipo", "Qt.", "Total €"]];
    const rowsTipos = Object.entries(totaisPorTipo).map(([tipo, info]) => [
      tipo, info.quantidade, info.valor.toLocaleString("pt-PT", { style: "currency", currency: "EUR" })
    ]);
    autoTable(doc, {
      head: headTipos,
      body: rowsTipos,
      startY: y,
      didDrawPage: () => {},
      theme: "striped",
      headStyles: { fillColor: [30, 136, 229] },
      styles: { cellPadding: 1.2, fontSize: 9 }
    });

    y = doc.lastAutoTable.finalY + 7;

    // Totais por operador (mini-tabela)
    doc.text("Totais por operador:", 10, y);
    y += 4;
    const headOps = [["Operador", "Qt.", "Total €"]];
    const rowsOps = Object.entries(totaisPorOperador).map(([op, info]) => [
      op, info.quantidade, info.valor.toLocaleString("pt-PT", { style: "currency", currency: "EUR" })
    ]);
    autoTable(doc, {
      head: headOps,
      body: rowsOps,
      startY: y,
      theme: "striped",
      headStyles: { fillColor: [46, 125, 50] },
      styles: { cellPadding: 1.2, fontSize: 9 }
    });

    y = doc.lastAutoTable.finalY + 9;

    // Vendas visíveis (tabela grande)
    doc.setFontSize(12);
    doc.text("Vendas listadas:", 10, y);
    y += 3;
    autoTable(doc, {
      head: [["Número", "Tipo", "Valor", "Hora", "Operador", "Data"]],
      body: vendasFiltradas.map(v => [
        v.numero,
        v.tipo,
        v.preco,
        v.hora,
        v.operador || "-",
        v.dataISO?.slice(0, 10) || "-"
      ]),
      startY: y,
      theme: "grid",
      headStyles: { fillColor: [255, 214, 0] },
      styles: { cellPadding: 1.2, fontSize: 9 }
    });

    doc.save("Resumo_Vendas.pdf");
  }

  return (
    <Paper sx={{ mt: 3, p: 3 }}>
      <Typography variant="h5" gutterBottom>
        Todas as Vendas (Admin)
      </Typography>
      
      {/* Resumo estatístico */}
      <Box sx={{ mb: 2 }}>
        <Stack direction={{ xs: "column", md: "row" }} spacing={2} alignItems="flex-start">
          <Box sx={{ minWidth: 220, maxWidth: 320 }}>
            <Typography variant="subtitle1" fontWeight={700}>Totais por Tipo:</Typography>
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Tipo</TableCell>
                  <TableCell>Qt.</TableCell>
                  <TableCell>Total €</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {Object.entries(totaisPorTipo).map(([tipo, info]) => (
                  <TableRow key={tipo}>
                    <TableCell>{tipo}</TableCell>
                    <TableCell>{info.quantidade}</TableCell>
                    <TableCell>{info.valor.toLocaleString("pt-PT", { style: "currency", currency: "EUR" })}</TableCell>
                  </TableRow>
                ))}
                <TableRow sx={{ bgcolor: "#eeeeee", fontWeight: "bold" }}>
                  <TableCell>Total</TableCell>
                  <TableCell>{totalQuant}</TableCell>
                  <TableCell>{totalValor.toLocaleString("pt-PT", { style: "currency", currency: "EUR" })}</TableCell>
                </TableRow>
              </TableBody>
            </Table>
          </Box>
          <Box sx={{ width: 240, height: 180, display: "flex", alignItems: "center", justifyContent: "center" }}>
            <ResponsiveContainer width="100%" height={160}>
              <PieChart>
                <Pie
                  data={pieData}
                  dataKey="value"
                  nameKey="name"
                  outerRadius={44}
                  fill="#1976d2"
                  label
                >
                  {pieData.map((entry, i) => (
                    <Cell key={entry.name} fill={entry.cor} />
                  ))}
                </Pie>
                <Legend />
                <ChartTooltip />
              </PieChart>
            </ResponsiveContainer>
          </Box>
          <Box sx={{ width: 340, height: 180 }}>
            <Typography fontWeight={700} sx={{ mb: 1 }}>Totais por Operador:</Typography>
            <ResponsiveContainer width="100%" height={130}>
              <BarChart data={barData}>
                <XAxis dataKey="operador" />
                <YAxis allowDecimals={false} />
                <Bar dataKey="quantidade" fill="#1976d2" />
                <ChartTooltip />
                <Legend />
              </BarChart>
            </ResponsiveContainer>
          </Box>
        </Stack>
      </Box>
      <Divider sx={{ my: 2 }} />

      {/* Filtros */}
      <Stack direction={{ xs: "column", md: "row" }} spacing={2} mb={3}>
        <TextField
          label="Filtrar por operador"
          select
          size="small"
          value={filtroOperador}
          onChange={e => setFiltroOperador(e.target.value)}
          sx={{ width: 220 }}
        >
          <MenuItem value="todos">Todos</MenuItem>
          {operadoresUnicos.map(nome => (
            <MenuItem key={nome} value={nome}>{nome}</MenuItem>
          ))}
        </TextField>

        <TextField
          label="Filtrar por data"
          type="date"
          size="small"
          value={filtroData}
          onChange={e => setFiltroData(e.target.value)}
          InputLabelProps={{ shrink: true }}
        />

        <Button variant="outlined" onClick={exportarPDF}>
          Exportar PDF Resumo
        </Button>
      </Stack>

      <TableContainer>
        <Table>
          <TableHead>
            <TableRow sx={{ bgcolor: "#eeeeee" }}>
              <TableCell>Número</TableCell>
              <TableCell>Tipo</TableCell>
              <TableCell>Valor</TableCell>
              <TableCell>Hora</TableCell>
              <TableCell>Operador</TableCell>
              <TableCell>Data</TableCell>
              <TableCell>Apagar</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {vendasFiltradas.map(v => (
              <TableRow key={v.id}>
                <TableCell>{v.numero}</TableCell>
                <TableCell>{v.tipo}</TableCell>
                <TableCell>{formatMoney(v.preco)}</TableCell>
                <TableCell>{v.hora}</TableCell>
                <TableCell>{v.operador || "-"}</TableCell>
                <TableCell>{v.dataISO?.slice(0, 10) || "-"}</TableCell>
                <TableCell>
                  <Tooltip title="Apagar venda">
                    <IconButton color="error" onClick={() => apagar(v.id)}>
                      <DeleteIcon />
                    </IconButton>
                  </Tooltip>
                </TableCell>
              </TableRow>
            ))}
            {vendasFiltradas.length === 0 && (
              <TableRow>
                <TableCell colSpan={7}>
                  <Typography variant="body2" align="center" sx={{ mt: 2 }}>
                    Nenhuma venda encontrada com os filtros aplicados.
                  </Typography>
                </TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
}
